export function add27(a: number, b: number): number {
  return a + b;
}

export function subtract27(a: number, b: number): number {
  return a - b;
}

export function multiply27(a: number, b: number): number {
  return a * b;
}

export function divide27(a: number, b: number): number {
  return a / b;
}
